import React from "react";

export const Footer = () => {
  return (
    <footer className={"footer"}>
      <div className={"auth-bg"}
           style={{
             backgroundImage: `url(${require('../assets/—Pngtree.png')})`,
             backgroundPosition: 'center',
             backgroundSize: 'cover',
             backgroundRepeat: 'no-repeat',
           }}
      >
        <div className={"d-flex flex-column align-items-center col-md-12 justify-content-center"}>
          <div className={'sub-footer-holder'}>
            <div className={""}
                 style={{
                   backgroundImage: `url(${require('../assets/—Pngtree.png')})`,
                   backgroundPosition: 'center',
                   backgroundSize: 'cover',
                   backgroundRepeat: 'no-repeat',
                   backgroundColor: '#4d9e39',
                   height: "290px",
                   width: "90%",
                   marginTop: "-100px",
                   borderRadius: "20px"
                 }}
            >

            </div>
          </div>
        </div>
      </div>
    </footer>
  )
}
